import styles from "../../styles/NavBar.module.css";
const NavBar = () => {
  return (
    <div className={styles.back}>
      <p className="section">About</p>
      <p className="section">Experience</p>
      <p className="section">Projects</p>
    </div>
  );
};

export { NavBar };
